import React, { useState } from "react";
import { Outlet } from "react-router-dom";
import { Footer } from "../components/Footer";
import { ModalAddMoment } from "../components/ModalAddMoment";
import { Navbar } from "../components/Navbar";

type RootProps = {
  isLogged: boolean
} 
export const Root: React.FC<RootProps> = ({isLogged}) => {
  function search() {
    console.log("search");
  }

  const [IsOpenAddMoment, setIsOpenAddMoment] = React.useState(false);

  function addMomemt() {}
  return (
    <>
      <Navbar
        isLogged={isLogged}
        openModal={() => setIsOpenAddMoment(true)}
        search={search}
      />

      <div id="detail">
        <Outlet />
      </div>

      <ModalAddMoment
        modalState={{
          isOpen: IsOpenAddMoment,
          setIsOpen: setIsOpenAddMoment,
        }}
        addMoment={addMomemt}
      />
      <Footer />
    </>
  );
};
